const HeadlineSubhead = () => {
  return (
    <div className="self-stretch bg-background flex flex-col py-20 px-0 items-center justify-start text-left text-32xl text-text font-h1-work-sans">
      <div className="w-[1050px] flex flex-col items-start justify-start gap-[20px]">
        <div className="self-stretch flex flex-row items-start justify-start">
          <div className="flex-1 relative leading-[110%] capitalize font-semibold">
            CV Analysis
          </div>
        </div>
        <div className="self-stretch flex flex-col items-start justify-start text-3xl">
          <div className="self-stretch relative leading-[160%]">
            Unlock the power of personality analysis in job search with our CV
            analysis page for our Sumer
          </div>
        </div>
      </div>
    </div>
  );
};

export default HeadlineSubhead;
